import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import {Button, Stack} from "@mui/material";
import EditIcon from '@mui/icons-material/Edit';
import IconButton from "@mui/material/IconButton";
import DeleteConfirmationDialog from "./deleteConfirmationDialog";
import EditEventDrawer from "./editEventDrawer";
import SeeDetailsDialog from "./seeDetailsDialog";
import {useEffect, useState} from "react";
import {getLocations} from "../../api/index";
import axios from "axios";


const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: 'gray',
        color: theme.palette.common.white,
        padding: '11px',
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

export default function LocationsTable() {
    const [locations, setLocations] = useState([]);
    useEffect(() => {
        getLocations()
    }, [locations]);

    async function getLocations()
    {
        await axios.get('http://localhost:3005/admin/getLocations').then(resp => {
            console.log(resp);
            setLocations(resp.data.locations);
        });
        console.log("haha");
    }
    getLocations();

    return (
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 700 }} aria-label="customized table">
                <TableHead>
                    <TableRow>
                        <StyledTableCell align="center">Details</StyledTableCell>
                        <StyledTableCell align="right">Address</StyledTableCell>
                        <StyledTableCell align="right">Latitude</StyledTableCell>
                        <StyledTableCell align="right">Longitude</StyledTableCell>
                        <StyledTableCell align="left">Actions</StyledTableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {locations.map((row) => (
                        <StyledTableRow key={row.id}>
                            <StyledTableCell align="right">{row.details}</StyledTableCell>
                            <StyledTableCell align="right">{row.adress}</StyledTableCell>
                            <StyledTableCell align="right">{row.latitude}</StyledTableCell>
                            <StyledTableCell align="right"><SeeDetailsDialog details={row.longitude}/></StyledTableCell>
                            <StyledTableCell>
                                <Stack direction="row" spacing={1}>
                                    <EditEventDrawer/>
                                    <DeleteConfirmationDialog/>
                                </Stack>
                            </StyledTableCell>
                        </StyledTableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
}
